import QuoteList from '../components/quotes/QuoteList'

const dummy_quotes = [
    {id: 'q1', author: 'max', text: 'learning react'},
    {id: 'q2', author: 'john', text: 'learning ts'}
]

export default function AllQuotes(){
    return (
        <QuoteList quotes={dummy_quotes}/>
    )
}
